import React from 'react';

const Social = () => {
    return (
        <div className="home__social">
            <a href="https://www.instagram.com/mihirjain_04/?igsh=MThyYWp1OHdtNDhycg%3D%3D" className="home__social-icon" target="blank">
                <i className="uil uil-instagram"></i>
            </a>

            <a href="https://www.linkedin.com/in/mihirjain04" className="home__social-icon" target="blank">
                <i className="uil uil-linkedin"></i>
            </a>

            <a href="https://github.com/Mihirjain06" className="home__social-icon" target="blank">
                <i className="uil uil-github"></i>
            </a>
        </div>
    );
}

export default Social;
